C,T=math.cos,0

function BDR(y)
 for i=3,47 do
  poke(16320+i,127+C(i%3*(C(T*.002)*2.4)+i/(70+C(T*.003)*30)-y*.008)*127)
 end
end

function TIC()
 cls(1)
 for i=0,99 do
  A=C(T*.013)/2-i*(C(T*.0027)+3)
  L=220*C(i/63)
  j,k,l=D(0),D(.3),D(.6)
  tri(
   j.x,j.y,k.x,k.y,l.x,l.y,
			8+C(i*C(T*.003))*7
		)
 end
 T=T+1
end

function D(a)
 a=A/3+a*(6.2-C(T*.008)*3)
 x,y=C(a)*L,C(a-11)*L
 return {x=120+x+y*C(T*.02),y=68+y}
end

